[include shell_command.cfg]
[include mainsail.cfg]
[include TEST_SPEED.cfg]
[include config_backup.cfg]
[include configs/common/*.cfg] # Load common configs first
[include configs/*.cfg]
[include macros/common/*.cfg] # Load common macros first
[include macros/*.cfg]
[include printer_variable.cfg]
[include sensorless_2.cfg]
[include ./Demon_Essentials_Voron_2.4_Edition/*.cfg]
#[include rpi.cfg]
[include motors_sync.cfg]
[include macros.cfg]

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_2D003E001751313338343730-if00

[temperature_sensor KRAKEN MCU]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

[mcu rpi]
serial: /tmp/klipper_host_mcu
[temperature_sensor RPI]
sensor_type: temperature_host
min_temp: 0
max_temp: 100

[mcu EBBCan]
canbus_uuid: 41d2fa09dbe9
[temperature_sensor EBB36 CAN]
sensor_type: temperature_mcu
sensor_mcu: EBBCan
min_temp: 0
max_temp: 100

[temperature_sensor CHAMBER]  
sensor_type: NTC 100K MGB18-104F39050L32
pullup_resistor: 4700
sensor_pin: PB1
min_temp: 0
max_temp: 100
gcode_id: C: C

[exclude_object]

[printer]
kinematics: corexy
max_velocity: 8000  
max_accel: 4000                 #Max 4000
max_z_velocity: 30          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5.0


[auto_speed]
axis: diag_x, diag_y  ; One or multiple of `x`, `y`, `diag_x`, `diag_y`, `z`
margin: 20            ; How far away from your axes to perform movements
settling_home: 1      ; Perform settling home before starting Auto Speed
max_missed: 20.0       ; Maximum full steps that can be missed
endstop_samples: 2    ; How many endstop samples to take for endstop variance
accel_min: 1000.0     ; Minimum acceleration test may try
accel_max: 50000.0    ; Maximum acceleration test may try
accel_accu: 0.05      ; Keep binary searching until the result is within this percentage
velocity_min: 50.0    ; Minimum velocity test may try
velocity_max: 5000.0  ; Maximum velocity test may try
velocity_accu: 0.05   ; Keep binary searching until the result is within this percentage
derate: 0.8           ; Derate discovered results by this amount
#validate_margin: Unset      ; Margin for VALIDATE, Defaults to margin
validate_inner_margin: 20.0 ; Margin for VALIDATE inner pattern
validate_iterations: 50     ; Perform VALIDATE pattern this many times
results_dir: ~/printer_data/config ; Destination directory for graphs

[respond]
default_type: echo
default_prefix:

[force_move]
enable_force_move: True

#####################################################################
#                     BTT KRAKEN AWD STEPPER SETTINGS
#####################################################################

#####################################################################
# S1 - REAR LEFT
#####################################################################

[stepper_y]
step_pin: PC14
dir_pin: !PC13
enable_pin: !PE6
microsteps: 32
rotation_distance: 40
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: tmc5160_stepper_y:virtual_endstop
position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 100 #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc5160 stepper_y]
cs_pin: PD6
spi_software_sclk_pin: PC6
spi_software_mosi_pin: PC8
spi_software_miso_pin: PC7
diag1_pin: ^!PC15
driver_SGT: 2
run_current: 2.000
sense_resistor: 0.022
stealthchop_threshold: 0
interpolate: false

#####################################################################
#S2 - REAR RIGHT
#####################################################################

[stepper_x]
step_pin: PE5
dir_pin: !PE4
enable_pin: !PE3
microsteps: 32
rotation_distance: 40
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: tmc5160_stepper_x:virtual_endstop
Position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 100 #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc5160 stepper_x]
cs_pin: PD5
spi_software_sclk_pin: PC6
spi_software_mosi_pin: PC8
spi_software_miso_pin: PC7
diag1_pin: ^!PF0
driver_SGT: 2
run_current: 2.000
sense_resistor: 0.022
stealthchop_threshold: 0
interpolate: false

#####################################################################
#S3 - FRONT LEFT
#####################################################################

[stepper_x1]
step_pin: PE2
dir_pin: !PE1
enable_pin: !PE0
microsteps: 32
rotation_distance: 40
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper

[tmc5160 stepper_x1]
cs_pin: PD4
spi_software_sclk_pin: PC6
spi_software_mosi_pin: PC8
spi_software_miso_pin: PC7
run_current: 2.000
sense_resistor: 0.022
stealthchop_threshold: 0
interpolate: false

#####################################################################
#S4 - FRONT RIGHT
#####################################################################

